// Import necessary components and styles
import React from 'react';
import Navbar from './Navbar';
import Slider from './Slider'; 
import RoomCards from './RoomCards';
import Footer from './Footer';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import './style.css';
import './bootstrap/dist/css/bootstrap.min.css';

// Other code

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/" component={Navbar} /> {/* Route for Login */}
          <Route path="/login" component={Login} /> {/* Route for Login */}
          <Route exact path="/" component={Slider} /> {/* Route for Slider on home */}
          <Route exact path="/" component={RoomCards} /> {/* Route for Slider on home */}
          <Route exact path="/" component={Footer} /> {/* Route for Slider on home */}
          {/* Add other routes as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
